I'm glad to hear you're interested in compiler optimization! Here are a few popular techniques along with simple examples to illustrate how they work:

1. **Constant Folding**: This technique replaces constant expressions with their computed values at compile time.

   *Example*:
   ```c
   int add(int a, int b) {
       return a + b;
   }

   int main() {
       int x = add(2, 3); // Before optimization
       // After constant folding:
       int x = 5;
   }
   ```

2. **Dead Code Elimination (DCE)**: DCE removes code that will never be executed or whose results are not used.

   *Example*:
   ```c
   int main() {
       int x = 10;
       int y = 20;
       int z = x + y; // z is never used
       return 0;
   }
   // After DCE:
   int main() {
       int x = 10;
       int y = 20;
       return 0;
   }
   ```

3. **Common Subexpression Elimination (CSE)**: CSE replaces multiple occurrences of the same expression with a single expression.

   *Example*:
   ```c
   int main() {
       int a = 5;
       int b = 10;
       int c = a + b; // c1
       int d = a + b; // c2
       return 0;
   }
   // After CSE:
   int main() {
       int a = 5;
       int b = 10;
       int c1 = a + b;
       int d = c1;
       return 0;
   }
   ```

