## Answer (1)

Here's how you can pack and unpack the data using bitwise operators.

```
function pack(entities) {
    let buffer = new ArrayBuffer(entities.length * 7);
    let view = new DataView(buffer);
    for (let i = 0; i < entities.length; i++) {
        let entity = entities[i];
        let byte = (entity.id & 0x0F) | ((entity.size & 0x07) << 4);
        view.setUint8(i * 7, byte);
    }
    return buffer;
}

function unpack(buffer) {
    let view = new DataView(buffer);
    let entities = [];
    for (let i = 0; i < buffer.byteLength; i += 7) {
        let byte = view.getUint8(i);
        let entity = {};
        entity.id = byte & 0x0F;
        entity.size = (byte >> 4) & 0x07;
        entities.push(entity);
    }
    return entities;
}
```

